import React from 'react';

/*Componentes */
import styles from '../css/Propiedad.module.css';

/*JSONs */
import dataProps from "../data.json";

function Propiedad(props){
    return(
    <div>
        <img 
          className='imagePropiedad'
          //src={require(`../images/${props.imagen}.png`)}
          alt={"Imagen de Propiedad " + props.nombre}/>
        <h1 className='namePropiedad'>Nombre de la Propiedad</h1>
        <h2 className='directionPropiedad'>Direccion de la Propiedad</h2>
        <p className='descriptionPropiedad'>Descriopcion de la propiedad</p>
        <h3 className='pricePropiedad'>XXX USD</h3>
    </div>
    );
}

export default Propiedad;
